import { Link } from "react-router-dom"
export default function Navbar(){
    return (
      <nav className="shadow px-4 py-2 flex flex-row justify-between items-center sticky top-0 bg-white">
        <div className="text-xl font-bold"><a href='/' >ChatVision</a></div>
        <Link to="/mock_interview">Mock Interview</Link>
        <Link to="/quiz_master">Quiz Master</Link>
        <Link to="/code_explainer">Code Explainer</Link>
      </nav>
    )
}
